import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Button, Container, Form, FormGroup, Label, Input, Row, Col } from 'reactstrap';
import './App.css';

function BusinessListing(props) {
  return (
    <Container className="listing">
      <Row>
        <Col>
          <h4>Business Listing</h4>
        </Col>
        <Col>
          <p>Results displayed: {this.state.businessesFound}</p>
        </Col>
      </Row>
      <Container className="bizList">
          {this.renderBusinesses()}
      </Container>
    </Container>
  );
}

export default BusinessListing;
